import React from 'react';
import Logo from "./logo.png"


const home = () => {
    return (
        <div>
            <a className="main-nav-logo" href="/">
                <img src={Logo} alt="Argent Bank Logo"/>
            </a>
      <div>
        <a className="main-nav-item" href="./signin">
          <i className="fa fa-user-circle"></i>
          Sign In
        </a>
      </div>
        </div>
    );
};

export default home;
